import React from "react";

export default class About extends React.Component {
  render() {
    return (
      <div>
        <p>
          Jie Liang Lin is an interdisciplinary artist and media anthropologist
          based in Berlin. Consultants: Joanna Sleigh, Data Visualisation Peggy
          Sylopp, Computer Science
        </p>
      </div>
    );
  }
}
